// import img1 from '../../images/banner/img-1.jpg'
// import img2 from '../../images/banner/img-2.jpg'
// import img3 from '../../images/banner/img-3.jpg'
// import img4 from '../../images/banner/img-4.jpg'
// import img5 from '../../images/banner/img-5.jpg'
// import img6 from '../../images/banner/img-6.jpg'
import Slider from "react-slick";
// import { baseUrl } from "./config";
import "~slick-carousel/slick/slick.css"; 
import "~slick-carousel/slick/slick-theme.css";

import React from 'react'

function Banner() {

  const bannerImgs = [
    {
      id : 1,
      src : '../../images/banner/img-1.jpg'
    },
    {
      id : 2,
      src : '../../images/banner/img-2.jpg'
    },
    {
      id : 3,
      src : '../../images/banner/img-3.jpg'
    },
    {
      id : 4,
      src : '../../images/banner/img-4.jpg'
    },
    {
      id : 5,
      src : '../../images/banner/img-5.jpg'
    },
    {
      id : 6,
      src : '../../images/banner/img-6.jpg'
    },
  ]

  const settings = {
    dots: true,
    lazyLoad: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    initialSlide: 2
  };

  return (
    <div className="banner">
      {
        bannerImgs.map(banner => (
          <Slider {...settings} key={banner.id}>
            <div >
              <img src={banner.src} alt="" />
            </div>
        </Slider>
        ))
      }
    </div>
  )
}

export default Banner
